import React, { Fragment } from "react";
import Grid from '@material-ui/core/Grid';
import FormatQuoteIcon from '@material-ui/icons/FormatQuote';
import FiberManualRecordIcon from '@material-ui/icons/FiberManualRecord';
import "./index.scss";

export const AboutUs = () => {
  return (
    <div>

      <div className='textoSuperior'>
        <h2>
          <span style={{ color: "#7ed9d9" }}>Acerca de</span> <span style={{ color: "#464F6D" }}> nosotros</span>
        </h2>
      </div>

      <Grid container className='general'>

        <Grid item xs={2} className='lineaExteriorIzquierda'>

        </Grid>
        <Grid item xs={1} className='lineaInteriorIzquierda'>

        </Grid>
        <Grid item xs={6} className='textoCentral'>
          <h4>Como todos sabemos, el 2019 fue un año bastante incierto. Todas las condiciones de ese año reinventaron el ecosistema alrededor del mundo. Durante este proceso, muchos de nuestros
            amigos, familiares e inclusive nosotros fuimos afectados. Nosotros batallamos para encontrar
            servicios que usualmente encontraríamos fácilmente. Servicios al público fueron cerrados
            como gimnasios, cafés, restaurantes, entre otros y algunos otros servicios fueron postergados
            como reuniones con psic ólogos, reuniones con diseñadores, clases de idiomas, tutorías de
            matemática o física, entre otros.</h4>
        </Grid>
        <Grid item xs={1} className='lineaInteriorDerecha'>

        </Grid>
        <Grid item xs={2} className='lineaExteriorDerecha'>

        </Grid>
      </Grid>
    </div>
  );
};
